import React, { Component } from 'react';
import './App.css';

import { Route, BrowserRouter as Router} from 'react-router-dom';

import Hub from './Hub'
import Home from './Home'
// import Sites from './Sites'
import About from './About'
import Header from './Header'

import {oXoptions, Camoptions} from './courselist'

class App extends Component {  


  render() {
    return (
      <Router>


     <div>
     <Header />
        <div className="background" id="home_bg">
            <Route exact path="/" component={Home} />
            <Route path="/the-hub" component={Hub} />
            {/* <Route path="/sites" component={Sites} /> */}
            <Route path="/about" component={About} />

            {oXoptions.map((value) => {  
              url = "/the-hub/" + "oxford" + value   
              // Return the element  
              return (<Route path={url} component={HubCoursePage} />) 
            })}

            {Camoptions.map((value) => {  
              url = "/the-hub/" + "cambridge" + value   
              // Return the element
              return (<Route path={url} component={HubCoursePage} />) 
            })}

        </div>

     </div>

    </Router>

    );
  }
} 

export default App;
